> Texas Student arrested for homemade clock visits White House President Barack Obama, right, shares a laugh with Agatha Sofia Alvarez-Bareiro, a high school senior from the Brooklyn borough of New York as Obama prepares to look at the moon at the second White House Astronomy Night on the South Lawn of the White House in Washington, Monday, Oct. 19, 2015. The event brings together students, teachers, astronomers, engineers, scientists, and space enthusiasts for an evening of stargazing. (AP Photo/Susan Walsh) 
